import React from 'react'

export default function Aboutme() {
  return (
    <div className='aboutme'>
      <p>
        Greetings to whoever is reading this! I'm Rishab, a devoted full-time software professional and a part-time blogger with a profound love for reading books.
        My journey led me to create this blog as a space to share insightful summaries of some of my favorite books.
        Through this platform, I aspire to provide a valuable resource for fellow readers and knowledge seekers.
        Join me in exploring the world of literature and ideas. Happy reading!
        </p>
    </div>
  )
}
